var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Welcome to MkDocs","text":"<p>For full documentation visit mkdocs.org.</p>"},{"location":"index.html#commands","title":"Commands","text":"<ul> <li><code>mkdocs new [dir-name]</code> - Create a new project.</li> <li><code>mkdocs serve</code> - Start the live-reloading docs server.</li> <li><code>mkdocs build</code> - Build the documentation site.</li> <li><code>mkdocs -h</code> - Print help message and exit.</li> </ul>"},{"location":"index.html#project-layout","title":"Project layout","text":"<pre><code>mkdocs.yml    # The configuration file.\ndocs/\n    index.md  # The documentation homepage.\n    ...       # Other markdown pages, images and other files.\n</code></pre>"},{"location":"blog/awesome_series.html","title":"Awesome Series","text":"<p>github awesome \u7cfb\u5217\u9879\u76ee\u6536\u5f55</p>"},{"location":"blog/awesome_series.html#self-improvement","title":"Self Improvement","text":"<ul> <li>awesome-falsehood</li> <li>awesome-courses</li> </ul>"},{"location":"blog/awesome_series.html#tools","title":"Tools","text":"<ul> <li>awesome-mac</li> </ul>"},{"location":"blog/awesome_series.html#tech","title":"Tech","text":"<ul> <li>awesome-java</li> <li>Awesome-Hacking</li> <li>awesome-scalability</li> <li>awesome-for-beginners</li> </ul>"},{"location":"blog/smart_is_a_choice.html","title":"\u806a\u660e\u662f\u4e00\u79cd\u9009\u62e9","text":"<p>\u4eca\u5929\u8bfb\u4e86 Paul Graham \u7684 \u300aWrites and Write-Nots\u300b \uff0c\u7a81\u7136\u610f\u8bc6\u5230\uff0c\u548c\u751f\u6d3b\u65b9\u5f0f\u4e00\u6837\uff0c\"\u806a\u660e\" \u5176\u5b9e\u5e76\u975e\u4e00\u79cd\u4e0e\u751f\u4ff1\u6765\u7684\u7279\u8d28\uff0c\u800c\u662f\u4e00\u79cd\u9009\u62e9\u3002 \u5728AI\u65f6\u4ee3\uff0c\u4eba\u7c7b\u5f88\u5feb\u5c31\u89e3\u653e\u4e86\u53cc\u624b\uff0c\u5c24\u5176\u662f\u5199\u4f5c\u8fd9\u4ef6\u4e8b\uff0c\u770b\u8d77\u6765\u597d\u50cf\u88ab\u5f7b\u5e95\u98a0\u8986\u4e86\u3002</p> <p>\u4f46\u662f\uff0c\u6211\u4eec\u8981\u655e\u5f00\u6000\u62b1\u62e5\u62b1\u8fd9\u79cd\u53d8\u5316\u5417\uff1f\u548c\u8bb8\u591a\u5176\u5b83\u884c\u4e1a\u4e00\u6837\uff0c\u5728\u79d1\u6280\u9769\u65b0\u4e4b\u540e\uff0c\u94c1\u5320\u3001\u8f66\u592b\u90fd\u6d88\u5931\u4e86\uff0c\u662f\u4e0d\u662f\u5199\u4f5c\u4e5f\u662f\u4e00\u6837\u5462\uff1f</p> <p>\u5e76\u4e0d\u662f\uff0c\u56e0\u4e3a\u6709\u4e00\u79cd\u80fd\u529b\u662f\u53ea\u6709\u5199\u4f5c\u80fd\u7ed9\u4e88\u6211\u4eec\u7684\uff0cLeslie Lamport \u5bf9\u6b64\u7684\u8868\u8ff0\u582a\u79f0\u6700\u4f73\uff1a</p> <p>If you're thinking without writing, you only think you're thinking.</p> <p>\u4eba\u7c7b\u9700\u8981\u901a\u8fc7\u5199\u4f5c\u601d\u8003\uff0c\u56e0\u6b64\u53ef\u9884\u6d4b\u7684\u662f\uff0c\u672a\u6765\u53ea\u5b58\u5728\u4e24\u79cd\u4eba\uff1a\u7cbe\u4e8e\u5199\u4f5c\u7684\u4eba\u548c\u5b8c\u5168\u4e0d\u4f1a\u5199\u4f5c\u7684\u4eba\uff0c\u4e4b\u524d\u7684\u4e2d\u95f4\u5730\u5e26\u5f7b\u5e95\u6d88\u5931\u6b86\u5c3d\u4e86\u3002</p> <p>\u5728\u524d\u5de5\u4e1a\u65f6\u4ee3\uff0c\u5927\u591a\u6570\u4eba\u7684\u5de5\u4f5c\u8ba9\u4ed6\u4eec\u53d8\u5f97\u5f3a\u58ee\u3002\u5982\u679c\u4f60\u60f3\u53d8\u5f97\u5f3a\u58ee\uff0c\u4f60\u5c31\u53bb\u953b\u70bc\u3002\u6240\u4ee5\u4ecd\u7136\u4f1a\u6709\u5f3a\u58ee\u7684\u4eba\uff0c\u4f46\u53ea\u6709\u90a3\u4e9b\u9009\u62e9\u5f3a\u58ee\u7684\u4eba\u3002\u5199\u4f5c\u4e5f\u662f\u4e00\u6837\u3002\u4ecd\u7136\u4f1a\u5b58\u5728\u6709\u806a\u660e\u4eba\uff0c\u4f46\u53ea\u6709\u90a3\u4e9b\u9009\u62e9\u6210\u4e3a\u806a\u660e\u4eba\u7684\u4eba\u3002</p>"},{"location":"cs/recommended-tech-books.html","title":"\u6280\u672f\u4e66\u7c4d\u63a8\u8350","text":""},{"location":"cs/recommended-tech-books.html#\u5206\u5e03\u5f0f","title":"\u5206\u5e03\u5f0f","text":"<ul> <li>\u300aDesigning Data-Intensive Applications\u300b</li> </ul>"}]}